import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import ImageDetail from '../components/ImageDetail';

const ImageScreen = () => {
    return (
        <View>
            {[
                require('../../assets/beach.jpg'),
                require('../../assets/forest.jpg'),
                require('../../assets/mountain.jpg')
            ].map((item, idx) => (
                <ImageDetail key={idx} title="Beach" imageSource={item} score={3 + idx}/>
            ))}
            {/*<ImageDetail title="Beach" imageSource={require('../../assets/beach.jpg')} score={3}/>
            <ImageDetail title="Forest" imageSource={require('../../assets/forest.jpg')} score={5}/>
            <ImageDetail title="Mountain" imageSource={require('../../assets/mountain.jpg')} score={9}/>*/}
        </View>
    );
}

const styles = StyleSheet.create({})

export default ImageScreen;
